# -*- coding:utf-8 -*-
from unittest import TestCase

from leet_lint_code.strings.find_alll_anagrams import Solution


class TestSolution(TestCase):
    def setUp(self):
        self.solution = Solution()

    def test_findAnagrams_lessThanP(self):
        result = self.solution.findAnagrams("s", "st")
        print(result)
        assert result == []

    def test_findAnagrams_sameSizeAsP(self):
        result = self.solution.findAnagrams("tsa", "ast")
        print(result)
        assert result == [0]

    def test_findAnagrams_notfound(self):
        result = self.solution.findAnagrams("ad", "bc")
        print(result)
        assert result == []

    def test_findAnagrams_found(self):
        result = self.solution.findAnagrams("adadadbndad", "da")
        print(result)
        assert result == [0, 1, 2, 3, 4, 8, 9]

    def test_findAnagrams_timeLimited(self):
        result = self.solution.findAnagrams(
            "",
            ""
            )
        print(result)
